    return (
      <div>
        <table>
          <tr>
            <input placeholder="Name" value={nameInput}></input>
          </tr>
          <tr>
            <input placeholder="Position" value={posInput}></input>
          </tr>
          <tr>
            <button onClick={() => console.log(nameInput)}>
              Add worker
            </button>
          </tr>
        </table>
      </div >
    )
  }
}


export default NewUserForm;
